( function( contra, $, undefined ) {

    var scrollToElement = function( offset, duration ) {
        duration = duration || 600;
        offset = offset || 50;
        // Select all links with hashes
        $('a[href*="#"]')
            // Remove links that don't actually link to anything
            .not('[href="#"]')
            .not('[href="#block-footer"]')
            .not('[href="#0"]')
            .click(function(event) {
                // On-page links
                if (
                    location.pathname.replace(/^\//, '') == this.pathname.replace(/^\//, '')
                    &&
                    location.hostname == this.hostname
                ) {
                    // Figure out element to scroll to
                    var target = $(this.hash);
                    target = target.length ? target : $('[name=' + this.hash.slice(1) + ']');
                    // Does a scroll target exist?
                    if (target.length) {
                        // Only prevent default if animation is actually gonna happen
                        event.preventDefault();
                        $('html, body').animate({
                            scrollTop: target.offset().top - offset
                        }, duration, function() {
                            // Callback after animation
                            // Must change focus!
                            var $target = $(target);
                            $target.focus();
                            if ($target.is(":focus")) { // Checking if the target was focused
                                return false;
                            } else {
                                $target.attr('tabindex','-1'); // Adding tabindex for elements not focusable
                                $target.focus(); // Set focus again
                            };
                        });
                    }
                }
            });
    };

    var scrollToElementOnload = function(offsetTop, duration) {
        duration = duration || 800;
        offsetTop = offsetTop || 50;
        // Figure out element to scroll to
        var target = $(window.location.hash);
        // Does a scroll target exist?
        if (target.length) {
            $('html, body').animate({
                scrollTop:  target.offset().top - offsetTop
            }, duration, function() {
                // Callback after animation
                // Must change focus!
                var $target = $(target);
                $target.focus();
                if ($target.is(":focus")) { // Checking if the target was focused
                    return false;
                } else {
                    $target.attr('tabindex','-1'); // Adding tabindex for elements not focusable
                    $target.focus(); // Set focus again
                };
            });
        }
    };

    var jumpMenuModal = function() {

        // $section = $( '.field > h2, .views--grid > h2, .block-title h2' );

        // $section.each( function() {
        //     $this = $( this );
        //     title = $this.text().toLowerCase();
        //     elementId = title.replace( /([^A-Za-z0-9[\]{}_.:-])\s?/g, '-' );
        //     $this.attr( 'id', elementId );
        // } );

        if( $( '#block-jumpmenus' ).length && $(window).width() < 768) {

            $( '#block-jumpmenus' ).clone().prependTo('main');
            scrollToElement(50,600);
        }

        setTimeout(scrollToElementOnload(), 900);

    };

    contra.jumpMenuModal = {
        init: jumpMenuModal
    };

}( window.contra = window.contra || {}, jQuery ) );

